import React from 'react';

function Header() {
  return (
    <header style={{ backgroundColor: '#2474F6', color: 'white', padding: '1rem', textAlign: 'center' }}>
      <h1>Распознавание образа огнестрельного оружия</h1>
        <h2>spectr.digit</h2>
    </header>
  );
}

export default Header;
